import React from "react"

class Users extends React.Component {
    usersList = [
        {
            id: 1,
            firstname: "Maksim",
            lastname: "Lebedko",
            placeOfWork: "SDvor",
            age: 13,
            isRich: false
        },
        {
            id: 2,
            firstname: "Gosha",
            lastname: "Pavlikov",
            placeOfWork: "SDvor",
            age: 21,
            isRich: true
        },
        {
            id: 3,
            firstname: "Ruslan",
            lastname: "Djambekov",
            placeOfWork: "Kontora",
            age: 41,
            isRich: true
        },
        {
            id: 4,
            firstname: "Dima",
            lastname: "Kukan",
            placeOfWork: "Kawaii",
            age: 15,
            isRich: true
        }
    ]
    render() {
      return (<div>
        {
        this.usersList.map((user) => {<div>
            <h3>{user.firstname} {user.lastname}</h3>
            <p>{user.placeOfWork}</p>
            </div>})}
      </div>)
    }
}

export default Users
